It’s not October but it is Women’s History Month and in honor of the breast cancer warriors who have fought and are still fighting I had my yearly mammogram today. I never miss it. And I always use it as a chance to remind you to make your appointment.🙏🏽After my breast cancer scare a couple of years ago, so many of you reached out and promised me you would finally do it. Does it hurt? Yeah, a  little. Is it worth it? Just think about all of those you love and who love you. 🤍
Have you made your appointment? Tomorrow is #internationalwomensday 
I think that’s a great day to do it! 🌻
