Strength, Wisdom and Courage…is what last night was all about. So proud to MC the inaugural Mission:Brain “With Ganas We Can
Change the World” event. We were in the presence of greatness. One of the top brain surgeons in the world Dr. Alfredo Quiñones-Hinojosa. This is a man who went from migrant farm worker to brain surgery. His mission is to cure brain cancer and until then he offers free brain surgery to those most in need. This event was to highlight his work, the immense need and to honor those who have paved the path in the Latino community. Leading the way for so many Mr.#edwardjamesolmos @mvegapena #jaimeescalante . About last night…it was truly an honor.🌻
